import React from 'react';
import Header from "./Header";
import Bg from "../Images/bg.png"
import BackgroounfImage from "./Backgroud"

function App(){
    return <div style={{ 
        backgroundImage: `url(${Bg})` 
      }}>
        <Header />
        <BackgroounfImage />
    </div> 
}

export default App;
